import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
  <div>
    <div className="page-heading">
    <h1 className="variable-glow">Welcome to the Verse of the Sun</h1>
    <p style={{textAlign: "center"}}>A universe by Richard Williams III</p>
    </div>
    <div className="page-content">
      <div>
        <p>
          The Verse of the Sun is a sci-fi dystopian depiction of the near future. 
          Mankind has reached the edge of the solarsystem, and seemingly impossible feats
          are made possible by advanced technology we posses.
        </p>
      </div>
      <div style={{display: 'flex', flexDirection: 'row', gap: '10px'}}>
      <div>
        <h2>Stories</h2>
      </div>
      <div>
        <h2>Games</h2>
      </div>
      </div>
    </div>

  </div>
  );
};

export default Home;
